import styled from 'styled-components';

export const LoginContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  .login__form {
    width: 610px;
    background: #fff;
    border-radius: 5px;
    margin-top: 56px;
    padding: 34px 118px;
    box-shadow: 0px 16px 32px rgba(221, 230, 237, 0.4);
    &-heading {
      text-align: center;
      margin-bottom: 30px;
    }

    &-input-group {
      margin-bottom: 20px;
      &-label {
        margin-bottom: 10px;
      }
      &-input {
        width: 374px !important;
        height: 50px !important;
      }
    }
    &-signup-btn {
      background: red;
    }
  }
`;
